// src/pages/MyAds.jsx
import React from "react";
import { FaTrash, FaShoppingCart } from "react-icons/fa";
import Sidebar from "../components/Sidebar"; 
const MyAds = () => {
  const adsData = [
    {
      id: 1,
      image: "https://via.placeholder.com/90",
      item: "Modern Kitchen",
      date: "Nov-25-2019 , 16:54 pm",
      type: "Sale",
      category: "Apartments",
      price: "$89",
      status: "Active",
    },
    {
      id: 2,
      image: "https://via.placeholder.com/90",
      item: "Villa",
      date: "Nov-22-2019 , 9:18 am",
      type: "Sale",
      category: "Homes",
      price: "$14,000",
      status: "Closed",
    },
    {
      id: 3,
      image: "https://via.placeholder.com/90",
      item: "2BHK Rooms",
      date: "Nov-15-2019 , 12:45 pm",
      type: "Buy",
      category: "RealEstate",
      price: "$22,765",
      status: "Sold",
    },
    {
      id: 4,
      image: "https://via.placeholder.com/90",
      item: "Luxury Rooms",
      date: "Nov-03-2019 , 12:50 pm",
      type: "Sale",
      category: "Deluxe Houses",
      price: "$35,978",
      status: "Inactive",
    },
  ];

  const statusColors = {
    Active: "bg-black/40 text-green-400 border-green-500",
    Closed: "bg-red-600 text-white border-red-700",
    Sold: "bg-green-700 text-white border-green-800",
    Inactive: "bg-purple-700 text-white border-purple-900",
  };

  return (
    <div className="min-h-screen bg-[#081120] py-10 px-4">
      <div className="max-w-6xl mx-auto bg-[#0E1A2B] shadow-xl rounded-xl p-6 text-white">

        {/* Title */}
        <h2 className="text-xl font-semibold mb-4">My Favorite Ads</h2>

        {/* TABLE */}
        <div className="overflow-x-auto">
          <table className="w-full border border-gray-700">

            {/* TABLE HEAD */}
            <thead className="bg-[#0D1626] text-gray-300 uppercase text-sm">
              <tr>
                <th className="p-4 border border-gray-700">‚†Ä</th>
                <th className="p-4 border border-gray-700 text-left">Item</th>
                <th className="p-4 border border-gray-700 text-left">Category</th>
                <th className="p-4 border border-gray-700 text-left">Price</th>
                <th className="p-4 border border-gray-700 text-left">Ad Status</th>
                <th className="p-4 border border-gray-700 text-left">Action</th>
              </tr>
            </thead>

            {/* TABLE BODY */}
            <tbody>
              {adsData.map((ad) => (
                <tr key={ad.id} className="bg-[#102038] border border-gray-700 hover:bg-[#142844]">

                  {/* CHECKBOX */}
                  <td className="p-4 border border-gray-700">
                    <input type="checkbox" className="w-4 h-4" />
                  </td>

                  {/* ITEM COLUMN */}
                  <td className="p-4 border border-gray-700">
                    <div className="flex gap-4">

                      <img
                        src={ad.image}
                        alt={ad.item}
                        className="w-20 h-20 object-cover rounded-lg border border-gray-600"
                      />

                      <div>
                        <h3 className="font-semibold">{ad.item}</h3>

                        <div className="text-sm text-gray-300 mt-1">
                          <p>‚è∞ {ad.date}</p>
                          <p>üè∑ {ad.type}</p>
                        </div>
                      </div>

                    </div>
                  </td>

                  {/* CATEGORY */}
                  <td className="p-4 border border-gray-700">{ad.category}</td>

                  {/* PRICE */}
                  <td className="p-4 border border-gray-700 font-bold">{ad.price}</td>

                  {/* STATUS BADGE */}
                  <td className="p-4 border border-gray-700">
                    <span
                      className={`px-3 py-1 rounded-md text-xs font-semibold border ${statusColors[ad.status]}`}
                    >
                      {ad.status}
                    </span>
                  </td>

                  {/* ACTION ICONS */}
                  <td className="p-4 border border-gray-700">
                    <div className="flex gap-3">

                      <button className="bg-[#0EA5E9] hover:bg-[#0284C7] p-2 rounded-md">
                        <FaTrash color="white" size={14} />
                      </button>

                      <button className="bg-black/40 hover:bg-black p-2 rounded-md">
                        <FaShoppingCart color="white" size={14} />
                      </button>

                    </div>
                  </td>

                </tr>
              ))}
            </tbody>

          </table>
        </div>

      </div>
    </div>
  );
};

export default MyAds;
